$(function() {

    // Load large google map in colorbox
    $('.enlarge-map').colorbox( { iframe: true, innerWidth: 800, innerHeight: 600 } );
    $('.zoom').colorbox( {maxWidth: 800, maxHeight: 600 } );

    // Ajax geocoding query
    $('form.map-search').submit(function(){
        var address = $('input.map-search').val();

        // add local information
        address += ' Riegelsberg, Deutschland';

        var identifier = $('input.map-search').data('map-identifier');

        $('#'+identifier).gmap('search', { 'address': address }, function(results, status) {
            if ( status === 'OK' ) {
                $('#'+identifier).gmap('get', 'map').panTo(results[0].geometry.location);
            }
        });

        return false;
    });
});